window.bookSummaryJSON = "<p><b>I was raised on lies, but the truth might be the death of me.</b></p> <p>It wasn’t easy to free my mind from all the lies the Lux Academy raised me on, but I’m finally coming to terms with who I really am.</p> <p>I’ve only started to accept my new life and what I must do when Val—the only friend I thought I had left from my previous life—kidnaps me and promises to make me pay for Magistrate Magnus’s death.</p> <p>As he drags me away, I know I won’t get a fair trial and must accept my grim fate.</p> <p>But I’m in for a surprise because my new pack isn’t ready to give up on me and is determined to make me a candidate in their alpha trials.</p> <p>Will the shifter blood running in my veins help me rise to the challenge? Or will the city rat remain a city rat forever?</p> <p><b>If you enjoy Leia Stone, Jaymin Eve, Patricia Briggs, Ilona Andrews, Kelly St. Claire, Shannon Mayer, Linsey Hall, or anything paranormal romance, you will love this series.</b></p> <p>Author Note: This book is not RH.</p>"; 
